// components/MegaMenu.js
import React from "react";
import { MegaMenu } from "primereact/megamenu";
import "primereact/resources/themes/lara-light-blue/theme.css";
import "primereact/resources/primereact.min.css";
import "primeicons/primeicons.css";
import "./MegaMenu.css";

const items = [
  {
    label: "تم‌ها",
    items: [
      [
        {
          label: "دخترانه",
          items: [{ label: "یونیکورن" }, { label: "باربی" }],
        },
      ],
    ],
  },
  {
    label: "لوازم تولد",
    items: [
      [
        {
          label: "بادکنک‌ها",
          items: [{ label: "بادکنک هلیومی" }, { label: "بادکنک لاتکسی" }],
        },
      ],
    ],
  },
  {
    label: "لوازم کمکی",
    items: [
      [
        {
          label: "وسایل سرو",
          items: [{ label: "چاقو" }, { label: "لیوان" }],
        },
      ],
    ],
  },
  {
    label: "آتش‌بازی",
    items: [
      [
        {
          label: "فشفشه‌ها",
          items: [{ label: "فشفشه ساده" }, { label: "آبشار" }],
        },
      ],
    ],
  },
];

export default function MegaMenuComponent({ className }) {
  return (
    <MegaMenu
      model={items}
      className="rtl-megamenu"
      orientation="vertical"
      breakpoint="50px"
    />
  );
}
